import React from 'react';
import styles from '../styles/NewsSection.module.scss';

const NewsCard = ({image, category, title, description, showScore, score, showDate, date}) => {
    return (
        <div className={styles.newsCard}>
            <div className={styles.newsImage}>
                <img src={image} alt={title}/>
                <span className={`${styles.category} ${styles[category.toLowerCase()]}`}>{category}</span>
            </div>
            <div className={styles.newsContent}>
                <h3>{title}</h3>
                {description && <p>{description}</p>}

                {showScore && (
                    <div className={styles.matchScore}>
                        <span className={styles.team}>{score.team1}</span>
                        <span className={styles.score}>-</span>
                        <span className={styles.team}>{score.team2}</span>
                    </div>
                )}

                {showDate && (
                    <div className={styles.newsDate}>
                        <i className="far fa-calendar"></i>
                        <span>{date}</span>
                    </div>
                )}
            </div>
        </div>
    );
};

const NewsSection = () => {
    const news = [
        {
            id: 1,
            image: 'https://img.mlbstatic.com/mlb-images/image/upload/c_fill,g_auto/w_640/v1/mlb/zdjfgkgf3llltlqvnj1q',
            category: 'Cricket',
            title: 'Seattle Orcas: Know All About Players, Owners, Captains & More',
            description: 'Check out Seattle Orcas owners, captains, players, coaches.',
            showScore: false,
            showDate: true,
            date: '10 June 2025'
        },
        {
            id: 2,
            image: 'https://cdn.vox-cdn.com/thumbor/yM0aNi-COO0JkF_kTptYHi4Z2yE=/0x0:3788x2526/1200x800/filters:focal(1908x414:2548x1054)/cdn.vox-cdn.com/uploads/chorus_image/image/73022744/1844426106.0.jpg',
            category: 'Football',
            title: 'Bangladesh 1-2 Singapore Player Ratings: Clinical Lions Edge Out Bengals',
            showScore: true,
            score: {
                team1: '1',
                team2: '2'
            },
            showDate: true,
            date: '10 June 2025'
        },
        {
            id: 3,
            image: 'https://cdn.dnaindia.com/sites/default/files/styles/full/public/2023/06/09/2595736-wtc-final.jpg',
            category: 'Cricket',
            title: 'Australia, South Africa Announce Playing XI For WTC Final 2025',
            showScore: false,
            showDate: true,
            date: '10 June 2025'
        },
        {
            id: 4,
            image: 'https://img.bundesliga.com/tachyon/sites/2/2021/05/2021_0627_BLMatchDayAgency_MI10_24_FCB_BMG_0-14_MatchDay10_FCBayern_1920x1080-1.jpg',
            category: 'Football',
            title: 'Slovakia U21 vs Spain U21 Prediction, Preview, Team News and More',
            showScore: false,
            showDate: true,
            date: '11 June 2025'
        },
        {
            id: 5,
            image: 'https://ichef.bbci.co.uk/onesport/cps/624/cpsprodpb/B955/production/_132098571_gettyimages-1938570224.jpg',
            category: 'Cricket',
            title: 'IPL 2025: Complete List of Retained Players and Remaining Purse',
            showScore: false,
            showDate: true,
            date: '12 June 2025'
        },
        {
            id: 6,
            image: 'https://cdn.nba.com/manage/2023/10/gettyimages-1772599326-1-1536x864.jpg',
            category: 'Basketball',
            title: 'NBA Finals 2025: Complete Schedule and How to Watch',
            showScore: false,
            showDate: true,
            date: '12 June 2025'
        }
    ];

    return (
        <section className={styles.news}>
            <div className={styles.container}>
                <div className={styles.sectionHeader}>
                    <h2>All Top News</h2>
                    <div className={styles.viewMore}>
                        <i className="fas fa-angle-right"></i>
                    </div>
                </div>

                <div className={styles.newsGrid}>
                    {news.map((item) => (
                        <NewsCard
                            key={item.id}
                            image={item.image}
                            category={item.category}
                            title={item.title}
                            description={item.description}
                            showScore={item.showScore}
                            score={item.score}
                            showDate={item.showDate}
                            date={item.date}
                        />
                    ))}
                </div>
            </div>
        </section>
    );
};

export default NewsSection;
